import React from 'react'
import './hero.css'
import Header from '../Header/Header'
const Hero = () => {
  return (
    <div className = "hero">
        <div className = 'left-side'>
            <Header/>
            <div className='best'></div>
        </div>
        <div className='right-side'></div>
    </div>
  )
}

export default Hero;
